import React from "react";
import ReactDOM from "react-dom/client";
import RoutePage from "./router";
import "lib-flexible";

const App = () => {
  return (
    <div className="mainPage">
      <div>111</div>
      <RoutePage />
    </div>
  );
};

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
